import { NavLink, N} from "react-router-dom";
import "/Users/luisjorge/code/Flatiron-Phase-2/16-Phase-2-Project/titan-capital-financial/public/Logo-without-background.png"
import "./NavBar.css"
function NavBar({ logout }) {

  return (
    <nav className="NavBar">
    <img className="NavBar__img"
        src="
/Users/luisjorge/code/Flatiron-Phase-2/16-Phase-2-Project/titan-capital-financial/public/Logo-without-background.png"
        alt="Companty logo"/>
    <div class="NavBar__links">
      <NavLink
        to="/"
        className="nav-link" 
      >
        Home
      </NavLink>
      <NavLink
        to="/about"
        className="nav-link"
      >
        About
      </NavLink>
      </div>
      {/* Add the logout function to handle the onClick event */}
      <button onClick={logout}>Logout</button>
    </nav>
  );
};

export default NavBar;
